window.bookSummaryJSON = "<p><b>The apocalypse may have rewritten the rules of physics, but not humanity.</b></p> <p>Adrian and his companions continue their journey toward Melbourne. The pathway through the post-apocalypse landscape continues to be harrowing; as they travel, they run into dysfunctional towns that need their help, and they must find unorthodox solutions to defeat the monsters that plague the landscape, some of which are extinction-level threats.</p> <p>Throughout it all, he focuses on growing the strength of himself and his team and getting to Melbourne as quickly as possible.</p> <p><i>Disquiet </i>continues the magical story telling of the first two books of Alpha Physics.</p>"; 
